import { HttpClient } from '@angular/common/http';
import { Component } from '@angular/core';

@Component({
  selector: 'app-eventos',
  templateUrl: './eventos.component.html',
  styleUrls: ['./eventos.component.scss']
})
export class EventosComponent {
  public eventos: any = [];
  public eventosfiltados: any = [];
  larguraImg = 150;
  margemImg = 2;
  mostraImagem = true;
  private _filtroLista = '';
  public get filtroLista(): string {
    return this._filtroLista;
  }
  public set filtroLista(value: string) {
    this._filtroLista = value;
    this.eventosfiltados = this.filtroLista ? this.filtrarEventos(this.filtroLista) : this.eventos;
  }
  filtrarEventos(filtroPor: string): any {
    filtroPor = filtroPor.toLocaleLowerCase();
    return this.eventos.filter(
      ( evento: { tema: string ; local: string} ) => evento.tema.toLocaleLowerCase().indexOf(filtroPor) !== -1 || evento.local.toLocaleLowerCase().indexOf(filtroPor) !== -1
    );
  }

  constructor(private http: HttpClient) { }
  ngOnInit(): void {
    this.getEventos();
  }

  public getEventos(): void {
    this.http.get('https://localhost:7027/api/Eventos').subscribe(
      response => {
        this.eventos = response;
        this.eventosfiltados = this.eventos;
      },
      error => console.log(error),
    );
  }

  ControlarImg() {
    this.mostraImagem = !this.mostraImagem;
  }
}
<h2>Eventos</h2>
<hr>
<div class="form-inline">
  <div class="form-group mb-2">

    <input type="text" class="form-control mr-2" placeholder="buscar" [(ngModel)]="filtroLista">
    <button class="btn btn-outline-success">Buscar</button>
  </div>
</div>
<h3>Filtro: {{filtroLista}}</h3>
<table class="table table-striped">
  <thead class="thead-dark">
    <tr>
      <th>
        <button type="button" class="btn btn-outline-light btn-sm" (click)="ControlarImg()">{{!mostraImagem ? 'Exibir' : 'Ocultar'}}</button>
      </th>
      <th>#</th>
      <th>Tema</th>
      <th>Local</th>
      <th>Data</th>
      <th>Qtd de Pessoas</th>
      <th>Lote</th>
      <th>Opções</th>
    </tr>
  </thead>
  <tbody *ngIf="eventos && eventos.length">
    <tr *ngFor="let evento of eventosfiltados">
      <td>
        <img  [collapse]="!mostraImagem" [isAnimated]="true" src="/assets/{{evento.imagemUrl}}" [style.width.px]="larguraImg" [style.margin.px]="margemImg">
      </td>
      <td>{{evento.eventoId}}</td>
      <td>{{evento.tema}}</td>
      <td>{{evento.local}}</td>
      <td>{{evento.dataEvento}}</td>
      <td>{{evento.qtdPessoas}}</td>
      <td>{{evento.lote}}</td>
      <td>sla</td>
    </tr>
  </tbody>
  <tfoot *ngIf="!eventos.length">
    <tr>
      <td colspan="8" class="text-center">
        <h4>Nenhum evento encontrado!</h4>
      </td>
    </tr>
  </tfoot>
</table>
